      function updateTableFilterOn(thisTable, thisEventTable, otherTable, otherEventTable) {

        if (typeof otherTable === 'undefined' || otherTable.colIdHopital == -2 || (thisTable.indirectDraw && otherTable.indirectDraw)) {
        /*if (typeof otherTable === 'undefined' || otherTable.colIdHopital == -2) return;
        if (thisTable.indirectDraw && otherTable.indirectDraw) {*/
          if (getColIndex(thisTable, 'id_hopital') == -1) {
            //console.log('update Établissement terminé')
            lastUpdate = 'Établissement'
            var filerRows = thisTable.rows({
              search: 'applied'
            }).data();
            if ((typeof otherTable === 'undefined' && thisEventTable.length !== filerRows.length) || (typeof otherTable !== 'undefined' && thisTable.inSearchTableLength !== filerRows.length)) {
              tableFilterOn = true;
              for (var i = 0; i < thisEventTable.length; i++) thisEventTable[i]["selected"] = false;
              filerRows.each(function(value, index) {
                for (var i = 0; i < thisEventTable.length; i++) {
                  if (thisEventTable[i]["id"] === value["id"]) {
                    thisEventTable[i]["selected"] = true;
                    //$('.dt-button.reinitBT').css('visibility', 'visible');
                  }
                }
              });
            }
            else {
              if (typeof otherTable !== 'undefined' && thisTable.colIdHopital != -2) {
                thisTable.colIdHopital = -2;
                otherTable.colIdHopital = -2;
                thisTable.draw()
              }
              tableFilterOn = false;
              for (var i = 0; i < thisEventTable.length; i++) thisEventTable[i]["selected"] = true;
              $('.dt-button.reinitBT').css('visibility', 'hidden');
            };
          }
          else {
            //console.log('update Services terminé')
            lastUpdate = 'Services'
            var filerRows = otherTable.rows({
              search: 'applied'
            }).data();
            //if (otherEventTable.length !== filerRows.length) {
            if (otherTable.inSearchTableLength !== filerRows.length) {
              tableFilterOn = true;
              for (var i = 0; i < otherEventTable.length; i++) otherEventTable[i]["selected"] = false;
              filerRows.each(function(value, index) {
                for (var i = 0; i < otherEventTable.length; i++) {
                  if (otherEventTable[i]["id"] === value["id"]) {
                    otherEventTable[i]["selected"] = true;
                    //$('.dt-button.reinitBT').css('visibility', 'visible');
                  }
                }
              });
            }
            else {
              if (otherTable.colIdHopital != -2) {
                thisTable.colIdHopital = -2;
                otherTable.colIdHopital = -2;
                otherTable.draw()
              }
              else {
                tableFilterOn = false;
                for (var i = 0; i < otherEventTable.length; i++) otherEventTable[i]["selected"] = true;
                $('.dt-button.reinitBT').css('visibility', 'hidden');
              }
            }
          }

          if ( isNewFilter() ) {
            thisTable.indirectDraw = false
            if (typeof otherTable !== 'undefined') {
              otherTable.indirectDraw = false
            }
            thisTable.colIdHopital = -1;
            if (typeof otherTable !== 'undefined') {
              otherTable.colIdHopital = -1;
            }
            isUpdating = true;
            $('.dt-button.reinitBT').css('visibility', 'visible');
          } else isUpdating = false

          function isNewFilter() {
            var myFilter = false;
            for (var i = 0; i < thisEventTable.length; i++) if( thisEventTable[i]["saved"] != thisEventTable[i]["selected"] ) myFilter = true;
            if (typeof otherTable !== 'undefined') for (var i = 0; i < otherEventTable.length; i++) if( otherEventTable[i]["saved"] != otherEventTable[i]["selected"] ) myFilter = true;
            return myFilter;
          }
         

          filterSave();
          //filterStore();
          function filterSave() {
            for (var i = 0; i < thisEventTable.length; i++) thisEventTable[i]["saved"] = thisEventTable[i]["selected"];
            if (typeof otherTable !== 'undefined') {
              for (var i = 0; i < otherEventTable.length; i++) otherEventTable[i]["saved"] = otherEventTable[i]["selected"];
            }
          }
          function filterStore() {
            if ($('#filterStore').length == 0) {
              var filterStore = $('<div id="filterStore" style="display:none"></div>')
              $('#infoMap-wrapper').prepend(filterStore)
            }
            else var filterStore = $('#filterStore');

            var valFilter = {
              test: true
            }
            filterStore.html(JSON.stringify(valFilter));
          }

          if (typeof otherTable !== 'undefined' && isUpdating)
          if (getColIndex(thisTable, 'id_hopital') == -1) {
            thisTable.draw()
          } else {
            otherTable.draw()
          }
          return;
        } 
        else {
          /*if (colIdHopital == -1) {
            console.log('update Établissement')
          } else {
            console.log('update Services')
          }*/
        }
        if (typeof otherTable !== 'undefined' && otherTable.colIdHopital != -2) {
          thisTable.indirectDraw = true;
          otherTable.colIdHopital = getColIndex(otherTable, 'id_hopital');
          //if(otherTable.colIdHopital > -1) return;
          if (otherTable.colIdHopital == -1) otherTable.colIdHopital = getColIndex(otherTable, 'id');

          var colIdHopital = getColIndex(thisTable, 'id_hopital');

          otherTable.selected = {};
          for (var i = 0; i < thisEventTable.length; i++) {
            if (colIdHopital > -1) var idString = thisEventTable[i]["id_hopital"].toString();
            else var idString = thisEventTable[i]["id"].toString();
            otherTable.selected[idString] = false;
          };
          for (var i = 0; i < thisEventTable.length; i++) {
            if (thisEventTable[i]["selected"]) {
              if (colIdHopital > -1) var idString = thisEventTable[i]["id_hopital"].toString();
              else var idString = thisEventTable[i]["id"].toString();
              otherTable.selected[idString] = true;
              //console.log('selected id_hopital : ' + idString);
            };
          }
          isUpdating = true;
          otherTable.draw()
          //var testTable = $('#myTableSearch').DataTable({ paging: false } )
          //testTable.destroy();
        } 
      }
      function getColIndex(paramTable, colTitle) {
        var trows = paramTable.rows().data();
        var uniquekey_colindex = paramTable.columns().count() - 1;
        for (var i = 0; i < uniquekey_colindex; i++) {
          var title = $(paramTable.column(i).header()).text();
          if (title.indexOf(colTitle) == 0) return i;
        }
        return -1;
      };
